import React, { useEffect, useState } from 'react';
import RemoveRedEyeIcon from '@material-ui/icons/RemoveRedEye';
import EditIcon from '@material-ui/icons/Edit';
import DeleteIcon from '@material-ui/icons/Delete';

import { NavLink } from 'react-router-dom';

const Table = () => {
  const [getUserData, setUserData] = useState([]);
  console.log(getUserData);

  const getdata = async() => {


    const res = await fetch("/getdata", {
        method:"GET",
        headers:{
            "Content-Type":"application/json"
        }

    })

    const data = await res.json();
    console.log(data);

    if(res.status === 404 || !data) {
        console.log("error");


    } else {
        setUserData(data);
        console.log("got  added");
    }
}

  useEffect(() => {
    getdata();
      },[])




  return(





   <>

       <div className="mt-5">


           <div className="container tb">
               <div className="add_btn mt-2 mb-2">
                   <NavLink to="/addissues" className="btn btn-primary">Add Issues</NavLink>

               </div>


               <table className="table">
  <thead>
    <tr className="table-dark">
      <th scope="col">id</th>
       <th scope="col">Name</th>
       <th scope="col">Age</th>
      <th scope="col">Mobile</th>
      <th scope="col">Work</th>
      <th scope="col">Add</th>
      <th scope="col">Desc</th>
    </tr>
  </thead>
  <tbody>

    {
      getUserData.map((element, id) => {
        return (
        <>
        <tr>
      <th scope="row">{id+1}</th>
      <td>{element.name}</td>
      <td>{element.age}</td>
      <td>{element.mobile}</td>
      <td>{element.work}</td>
      <td>{element.add}</td>
      <td>{element.desc}</td>


    <td className="d-flex justify-content-between">
       <button className="btn btn- "><RemoveRedEyeIcon/></button>
       <button className="btn btn  "><EditIcon/></button>
       <button className="btn btn "><DeleteIcon/></button>

    </td>
    </tr>


        </>
        )
      })

    }



  </tbody>
</table>
           </div>
       </div>






       </>




  )
};

export default Table;
